import React from 'react';
import './NavBar.css';
import CardItem from './CardItem.js';

function ItemListContainer(props){
    return(
        <div>
            <h1 className="title-home">{props.title}</h1>
            <CardItem
                src='.course1.jpeg'
                title='Hey'
            />
        </div>
    ); 
}

export default ItemListContainer;
